import React from 'react';

const Admin = () => {
    return (
        <div style={{width:'100%', alignItems:'center', justifyContent:'center'}} className='d-flex row gy-5 mt-5'>
            <button style={{width:'200px'}} className='border- rounded-4 bg-success text-white fs-5 p-3'></button>
        </div>
    );
};

export default Admin;
